    "## Graph our data with ggplot2"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "306cf4fc",
   "metadata": {
    "_cell_guid": "21cc4ce6-e5c8-43c6-960d-4e0fd1a3384d",
    "_uuid": "591d2aca4d10a849d96f5647914da2d79614b59d",
    "papermill": {
     "duration": 0.00488,
     "end_time": "2025-08-13T18:26:24.735395",
